INSERT INTO `catalog_pages` VALUES (12, 2, 'default_3x3', 'credit_furni', 'Cambio de divisas', 1, 146, 1, 0, 1, '1', '1', '0', '0', NULL, '', '', 'catalog_bank_headline1', 'catalog_bank_teaser', 'Habbo Exchange ist der Ort, an dem Sie Ihre Credits in eine handelbare Währung umwandeln können. Sie können diese Währung dann verwenden, um Furni einzutauschen oder einfach Ihren Reichtum in Ihrem Zimmer anzuzeigen.', '', '');
INSERT INTO `catalog_pages` VALUES (13, 603, 'spaces_new', 'spaces', 'Suelo', 1, 225, 1, 0, 2, '1', '1', '0', '0', NULL, '', '', 'look_feel_text', '', 'Böden, Tapeten, Landschaften: Holen Sie sich eine fantastische Kombination für Ihr Zimmer. Nutzen Sie unsere virtuelle Raumvorschau unten, um Kombinationen vor dem Kauf auszuprobieren. Wählen Sie das gewünschte Design und die gewünschte Farbe aus und klicken Sie auf Kaufen.', '', '');
