INSERT INTO `catalog_pages` VALUES (16, 603, 'default_3x3', 'lighting', 'Iluminación', 1, 115, 1, 0, 1, '1', '1', '0', '0', NULL, NULL, 'Click on an item for details.', 'catalog_dimmers_header1_en', 'catalog_dimmer_teaser_en', 'Schauen Sie sich Mood Lights an. Verwenden Sie diese Elemente, um das Licht in Ihren Räumen zu dimmen. Probieren Sie verschiedene Lichteinstellungen mit verschiedenen Hintergrundbildern aus, um zu sehen, was Sie bekommen. Sprechen Sie stilvoll über Beleuchtung!', '', '');
INSERT INTO `catalog_pages` VALUES (17, 568, 'default_3x3', 'mode', 'Modo', 1, 39, 1, 0, 11, '1', '1', '0', '0', '', '', '', 'catalog_mode_headline1', 'catalog_mode_teaser1', 'Steerne Funktionalität kombiniert mit eleganter Designerpolsterung. Der Habbo, der diese Möbel wählt, ist eine coole Stadtkatze: gerissen, wagemutig und ein wenig unantastbar.', '', '');
INSERT INTO `catalog_pages` VALUES (18, 568, 'default_3x3', 'lodge', 'Rural', 1, 37, 1, 0, 10, '1', '1', '0', '0', '', '', '', 'catalog_lodge_headline1', 'catalog_lodge_teaser1', 'Für den herrlichen Skikabineneffekt mit offenem Kamin und Whisky an der Seitenleiste. Dieses Sortiment ist für diejenigen, die die wahre Schönheit von Massivholz schätzen.', '', '');
