INSERT INTO `catalog_pages` VALUES (20, 602, 'default_3x3', 'vegetation', 'Plantas', 1, 3, 1, 0, 3, '1', '1', '0', '0', '', '', '', 'catalog_plants_headline1', 'catalog_plants_teaser1', 'Jedes Zimmer braucht eine Etage! Sie bringen nicht nur ein wenig nach außen in den Innenraum, sondern verbessern auch die Luftqualität! Und was gibt es Besseres für einen Freund als eine schöne Rose oder einen eleganten Obstbaum ...', '', '');
